import React from "react";
import WithCard from "components/container/withCard";
import { fetchUsers } from "api/db-init";

type Props = {
  env: string;
};

type State = {
  users: Promise;
};

export default class Saved extends React.Component<Props, State> {
  componentDidMount() {
    const users = fetchUsers(this.props.env);
    this.setState({ users });
  }
  render() {
    return <WithCard />;
  }
}
